import React from 'react';

const SongRow = ({ song }) => {
  return (
    <div className="song-row">
      <span></span>
      <span>{song.songName}</span>
      <span>{song.artistName}</span>
      {/* Add more song details as needed */}
    </div>
  );
}

export default SongRow;
